import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div className="App">
      <Router>
        <Header />
        <Routes>
          <Route path="/menu" element={<Menu />} />

          <Route path="/fooditem" element={<Fooditem />} />

          <Route path="/login" element={<Login />} />

          <Route path="/thanku" element={<Thanku />} />

          <Route exact path="/" element={<Home />} />
        </Routes>
        < Footer />
      </Router>
    </div>
  );
}

export default App;
